import './meny.css'
function Meny(){
    return(
        <div >

            <ul className='meny'>
                <li><a className='a' href="/home">Home</a></li>
                <li><a className='a' href="/animal">Animal</a></li>
                <li><a className='a' href="/food">Food</a></li>
                <li><a className='a'  href="/toys">Toys</a></li>
                <li><a className='a' href="/contact">Contact</a></li>
            </ul>
        </div>
    )
}
export default Meny;
